script: |
  super -f text -I q3511.spq | sort > q3511.out

inputs:
  - name: q3511.spq
    data: |
      SELECT ALL - col1 + - col2 + - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN ( tab0.col2 + - col1 + col0 ) AND NULL;
  - name: tab0

outputs:
  - name: q3511.out
    data: |
